import numpy as np
digits = ''
count = 0
other = 0
other2 = 8
arr =[]
result = []
temp = 1

while count < len(digits) / 8:
    arr.append(int(digits[other:other2]))
    other += 8
    other2 += 8  
    count += 1

print(arr)
print('\n')

new_arr = [str(elem) for elem in arr]


for i in new_arr:
    for j in i:
        temp *= int(j)
    result.append(temp)
    temp = 1

print(result)
final = max(result)
print('\n')
print(final)